import { NavLink } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";

export default function Nav() {
  return (
    <nav>
      <Navbar expand="lg" className="nav nav-pills nav-justified">
        {/* <Container> */}
          <Navbar.Brand>
            <NavLink to="/">
              <img src="./tlogo.png" alt="Tesla logo" />
            </NavLink>
          </Navbar.Brand>

          <NavLink to="allchargers">All Chargers</NavLink>
          <NavLink to="reviews">Reviews</NavLink>
        {/* </Container> */}
      </Navbar>

      {/* <nav>
        <NavLink to="/">Home</NavLink>
        <NavLink to="allchargers">All Chargers</NavLink>
        <NavLink to="reviews">Reviews</NavLink>
      </nav> */}
    </nav>
  );
}
